export const getAllPartners = (type: 'arabic' | 'foreign'): PartnerInstitution[] => {
  return type === 'arabic' ? arabicPartners : foreignPartners;
};

export const getActivePartners = (type: 'arabic' | 'foreign'): PartnerInstitution[] => {
  return getAllPartners(type).filter(partner => partner.isActive);
};

export const getPartnersByCategory = (type: 'arabic' | 'foreign', category: string): PartnerInstitution[] => {
  return getActivePartners(type).filter(partner => partner.category === category);
};
